// ToyHeader Component Function

function ToyHeader(props) {
    console.log(props);

    return (
        <div id={props.id}>
            <img
            src="https://fontmeme.com/permalink/180719/67429e6afec53d21d64643101c43f029.png"
            alt="toy-header"
            />
            <p>{props.name}</p>
        </div>
    );
}

export default ToyHeader;
